function FileImpersonation{

    ########Set Params###############################
    #set byte count. Valid range is from 1 - 100
    $byteCount= 50
    
    #Set epsilon value for DBscan.
    $eps= 255
    
    #set starting location for recursive Dir. Yes, this is intense but necessary. Using CMD is alot faster and less intense as get-childitem
    #ex: 'C:\users\'
    $folder= "$env:userprofile\Desktop\ml_test\testing_grounds\simple_test\"
    
    #######End Params###############################

    function build-class{
        $outputclass= [pscustomobject][ordered]@{
            IP= "null"
            Hostname= $null
            OperatingSystem= $null
            DateCollected= $null
            Source= "File-Impersonation"
            FileName= $null
            Message= $null
        }
    return $outputclass
    }  

    class DBSCAN{
        [double]$eps
        [int]$min_samples
        $clusters = @()
        $visited = @{}
        $noise = @()
    
        DBSCAN([double]$eps = 0.5, [int]$min_samples = 5){
            $this.eps = $eps
            $this.min_samples = $min_samples
        }

        static [double] GetDistance($pointA, $pointB){
            $sum = 0
            $pointA.GetEnumerator() | ForEach-Object{
                $dimension = $_.Key
                $difference = $_.Value - $pointB[$dimension]
                $sum += [math]::pow($difference, 2)
            }
            return [math]::sqrt($sum)
        }
    
        [array]RegionQuery($point){
            $neighbors = @()
            $global:data | ForEach-Object{
                if ([DBSCAN]::GetDistance($_, $point) -le $this.eps) {
                    $neighbors += $_
                }
            }
            return $neighbors
        }
    
        [void]ExpandCluster($point, $neighbors){
            $cluster = @($point)
            $this.visited[$point] = $true
    
            $i = 0
            while ($i -lt $neighbors.Count){
                $neighbor = $neighbors[$i]
                if (-not $this.visited[$neighbor]){
                    $this.visited[$neighbor] = $true
                    $neighborNeighbors = $this.RegionQuery($neighbor)
    
                    if ($neighborNeighbors.Count -ge $this.min_samples){
                        $neighbors += $neighborNeighbors
                    }
                }
    
                if (-not ($this.clusters | Where-Object { $_ -contains $neighbor })){
                    $cluster += $neighbor
                }
    
                $i++
            }
    
            $this.clusters += , $cluster
        }
    
        [void]Fit($data){
            $global:data = $data
    
            foreach ($point in $data){
                if (-not $this.visited[$point]){
                    $neighbors = $this.RegionQuery($point)
                    if ($neighbors.Count -lt $this.min_samples){
                        $this.noise += $point
                    } else{
                        $this.ExpandCluster($point, $neighbors)
                    }
                }
            }
        }
    
        [array]Predict($data){
            $predictions = @()
            $data | ForEach-Object{
                $point = $_
                $found = $false
                for ($i = 0; $i -lt $this.clusters.Count; $i++){
                    if ($this.clusters[$i] -contains $point){
                        $predictions += $i
                        $found = $true
                        break
                    }
                }
                if (-not $found){
                    $predictions += -1
                }
            }
            return $predictions
        }
    }

