    function process-Bytes($bytes){
        #Builds necessary data structure for DBSCAN based on the bytes from the master byte obj    
        $dataPoint = @{}
        for ($i = 0; $i -lt $bytes.Count; $i++) {
            $dataPoint["dim$($i + 1)"] = [string]$bytes[$i]
        }
        return $dataPoint
    }

    function dbscan_outliers($file,$eps,$byteCount,$overflowtype){
        $suspectfile = Get-Item $file
    
        #Build out legitimate byte-info for the file extension that the suspect file claims to be (aka friends)
        #Duplicate the data IOT ensure that there are no outliers in the baseline data -- do it twice.
        $friends= @("Extension,Bytes")
        $temp= $masterbyteobj | where {$_.extension -eq $($suspectfile.extension)} | convertto-csv -NoTypeInformation | where {$_ -ne '"Extension","Bytes"'}
        $friends+= $temp
        $friends+= $temp

        $canary_ext= $suspectfile.extension
        $canary_val= $(1..255 | get-random -count $byteCount)-join(' ')
        $canary= '"' + $canary_ext + '","' + $canary_val + '"'        
        $friends+= $canary

        $friends= $friends | convertfrom-csv

        #Build out list to store the filenames so they can be referenced later. The last item in the list is the name of the suspect file and all 'friends' are labled 'ml_data'
        $filenames = @()
        $x= 0
        $ml_count= $friends.count
    
        while ($x -le $ml_count){
            if ($x -eq $ml_count){
                $filenames+= $suspectfile.FullName
                break
            }
            $filenames+= "ML_data"
            $x++
        }
    
        #initialize array to hold byte data that will be fed to DBSCAN
        $dataset= @()
    
        #Get Byte Data for friends and throw it into the array
        foreach ($f in $friends){
            $bytes= $($f.bytes).split(' ').trimstart().trimend()
            $bytes= $bytes | % {[string]$_}
            $dataset+= process-Bytes $bytes
        }
    
        #Get Byte Data for suspect file and throw it into the array   
        $suspectfilename= $suspectfile.fullname
        $bytes = [System.IO.File]::ReadAllBytes($suspectfilename) | Select-Object -First $byteCount
        $bytes= $bytes | % {[string]$_}
        $dataset+= process-Bytes $bytes
    
        #Run DBSCAN
        $dbscan = [DBSCAN]::new($eps,2)  # Initialize with eps=5 and min_samples=2.
        $dbscan.Fit($dataset)  # Train the model with the data
        $predictions = $dbscan.Predict($dataset)  # Predict clusters for each data point
        
        if ($overflowtype -eq 'overflow'){
            $clusters= @("File,Cluster")
            for ($i=0; $i -lt $dataset.Length; $i++) {
                $clusters+= "$($filenames[$i]),$($predictions[$i])"               
            }
    
            $clusters= $clusters | convertfrom-csv

            return $clusters[-1]
        }

        #[-1] is an outlier. If the last value is -1, thats our guy; investigate further
        if ($predictions[-1] -eq -1){        
            $clusters= @("File,Cluster")
    
            for ($i=0; $i -lt $dataset.Length; $i++) {
                $clusters+= "$($filenames[$i]),$($predictions[$i])"               
            }
    
            $clusters= $clusters | convertfrom-csv
            #$clusters
    
            #if the outlier is indeed the supect file - append it to the final results
            if ($clusters[-1].cluster -eq -1){
                $output= "$($clusters[-1].file),$bytecount,$eps"
                return $output
            }

        }
    }
    
    #######Build out standard Metadata for all TGW modules
    $output= @()
    $hostname= $env:COMPUTERNAME
    $operatingsystem= $(Get-WmiObject win32_operatingsystem).name.tostring().split('|')[0]
    $date= (Get-Date -Format "dd-MMM-yyyy HH:mm").Split(":") -join ""
    
    #######Grab Files##############################
    $files= cmd /c dir $folder /B /S /A-D #way faster than get-childitem or other recurive dir methods
    
    
    #build out master byte object for file types based on the byte count provided
    new-variable -name MasterByteObj -Value $(Build-MasterByteObj $bytecount) -Scope global -Force -ErrorAction SilentlyContinue
    
    foreach ($file in $files){
        $results= build-class
        
        $overflowtype='none'
        $file= Get-Item $file
        $ext= $file.Extension 
        $filename= $file.fullname
              
        $Dbscan_output= dbscan_outliers $filename $eps $bytecount
    
        if ($Dbscan_output.count -gt 0){
            $string= "$ext - $eps"
            $results.Hostname= $hostname
            $results.OperatingSystem= $operatingsystem
            $results.DateCollected= $date
            $results.FileName = $filename
            $results.message = "Potenitally Bogus $ext File"
    
            $output+= $results | ConvertTo-Json
        }        
    }

    #for all outliers, step down the byte count from whatever it is set to down to 20 to see if they're still offenders
    $output= $output | convertfrom-json

    foreach ($o in $output){        
        $suspectfile= $o.filename
        $overflow= @()
        $overflow_bytecount= $byteCount

        while ($overflow_byteCount -ge 20){
            $overflowtype= "overflow"
            $overflow+= dbscan_outliers $suspectfile $eps $overflow_bytecount $overflowtype
            $overflow_bytecount= $overflow_bytecount - 1
        }

        #check overflow - Look to see if it's an outlier through and through --if so label it as 100 percent confidence
        if ($($overflow.cluster | sort -Unique | where {$_ -ne '-1'}).count -eq 0){
            #$output= $output | where {$_.filename -ne $suspectfile}
           $o | Add-Member -NotePropertyName confidence -NotePropertyValue 100
        }

        #get remaining stats
        if ($($overflow.cluster | sort -Unique | where {$_ -ne '-1'}).count -gt 0){
            $totalcount= $overflow.count
            $outlier_count= $($overflow.cluster | select-string '-1').count
            $percent= $outlier_count / $totalcount*100
            $confidence= [math]::floor($percent)
            $o | Add-Member -NotePropertyName confidence -NotePropertyValue $confidence
        }
    }        

    $output | convertto-csv -NoTypeInformation
}

